Cyclotron.getPopulationValue = function () {
    switch (Cyclotron.parameters.pop_valueproperty.toLowerCase()) {
        case 'gdp_millions':
            return 'gdp_millions'
        case 'population':
            return 'population';
        default:
            return 'population';
    }
}
Cyclotron.getPopulationValueDescription = function () {
    switch (Cyclotron.parameters.pop_valueproperty.toLowerCase()) {
        case 'gdp_millions':
            return 'GDP (millions)'
        case 'population':
            return 'population';
        default:
            return 'population';
    }
}
Cyclotron.getPopulationColor = function () {
    switch (Cyclotron.parameters.pop_colorproperty.toLowerCase()) {
        case 'growth_rate':
            return 'growth_rate';
        case 'population':
            return 'population'
        case 'gdp_millions':
            return 'gdp_millions'
        default:
            return 'growth_rate';
    }
}
Cyclotron.getPopulationColorFormat = function () {
    switch (Cyclotron.parameters.pop_colorproperty.toLowerCase()) {
        case 'growth_rate':
            return '0.00';
        case 'population':
            return '0a'
        case 'gdp_millions':
            return '0a'
        default:
            return '0.00';
    }
}
Cyclotron.getPopulationColorDescription = function () {
    switch (Cyclotron.parameters.pop_colorproperty.toLowerCase()) {
        case 'growth_rate':
            return 'growth rate';
        case 'population':
            return 'population'
        case 'gdp_millions':
            return 'GDP (millions)'
        case '':
            return '';
        default:
            return 'growth';
    }
}
Cyclotron.getPopulationColorStops = function () {
    switch (Cyclotron.parameters.pop_colorproperty.toLowerCase()) {
        case '': 
            return null;
        case 'population':
            return [{
                "value": "0",
                "color": "white"
            }, {
                "color": "#688398",
                "value": 10000000
            }, {
                "value": 40000000,
                "color": "#4D5A6D"
            }];
        case 'gdp_millions':
            return [{
                "value": "0",
                "color": "white"
            }, {
                "color": "#E5FCC2",
                "value": 100000
            }, {
                "value": 1000000,
                "color": "#9DE0AD"
            }, {
                "value": 5000000,
                "color": "#45ADA8"
            }, {
                "value": 15000000,
                "color": "#547980"
            }];
        default:
            // growth rate
            return [{
                "color": "#995351",
                "value": -1
            }, {
                "color": "#d3d339",
                "value": 8
            }, {
                "color": "#529951",
                "value": 35
            }];
    }
}
